class Solution:
    def evalRPN(self, tokens: list) -> int:
        stk = list()
        for i in tokens:
            if i == '+':
                a = stk.pop()
                b = stk.pop()
                stk.append(b + a)
            elif i == '-':
                a = stk.pop()
                b = stk.pop()
                stk.append(b - a)
            elif i == '*':
                a = stk.pop()
                b = stk.pop()
                stk.append(b * a)
            elif i == '/':
                a = stk.pop()
                b = stk.pop()
                stk.append(int(b / a))
            else:
                stk.append(int(i))
        return stk[-1]


